   "source": [
    "## 1.0 Introduction \n",
    "\n",
    "This is a Capstone Project for the Google Data Analytics Professional Certification. The following document is a deliverable for a case-study intended to model a real-word data analysis task. The company used in this report \"Cyclistic\" is a fictional company to represent the client business and the data are taken from [Divvy](https://divvy-tripdata.s3.amazonaws.com/index.html), the real world bike-share operating in Chicago. The data are offered for public use according to [this license agreement](https://ride.divvybikes.com/data-license-agreement).\n",
    "\n",
    "### 1.1 About the Case-Study\n",
    "Cyclistic is a company offering a bike-sharing program located in Chicago, IL. The service offers annual memberships that provide year-round access to the bikes within the fleet. Non-members (hereafter referred to as \"casual riders\") have the option of purchasing a day pass or using the service on a per-ride basis.\n",
    "\n",
    "In order to increase revenues, Cyclistic's marketing team needs to know how casual members tend to use the service in comparison to members so they may more effectively target potential membership converts. To accomplish this, I will analyze internally developed rider data to show how these two customer types use the bikeshare differently. \n",
    "\n",
    "I will review data gathering and cleaning techniques and will provide reproducible code so that this analysis can be replicated and improved upon by others if so desired. At the end of the report, three key recommendations will be made for the marketing team.\n",
    "\n",
    "### 1.2 Problem Scope and Strategy\n",
    "**Key Task:** Discover unique use-patterns for bikeshare members vs non-members, then contextualize findings to make recommendations for Cyclystic's marketing team. \n",
    "\n",
    "**Key Stakeholders**  \n",
    "- Lily Moreno: Director of Marketing at Cyclistic -- Primary contact for project    \n",
    "- Cyclistic Marketing Analytics Team: Team to be informed by analysis findings, source of domain expertise  \n",
    "- Cyclistic Executive Team: Decision-makers for approval of marketing program  \n",
    "\n",
    "### Strategy\n",
    "\n",
    "This project will utilize the 6 phases of data analysis as detailed in the Google Data Analyst career certificate: \n",
    "\n",
    "1. Ask : Define the business task\n",
    "2. Prepare : Describe and document all data sources used; determine analysis strategy\n",
    "3. Process : Clean and transform datasets for analysis, document these changes and retain version control\n",
    "4. Analyze : Execute analysis, interpret findings, create summaries\n",
    "5. Share : Create supporting visualizations, tables, figures, reports\n",
    "6. Act : Provide recommendations based on analysis\n",
    "\n",
    "**Deliverables:** \n",
    "- Project report via Jupyter Notebook on Kaggle \n",
    "- Shareable RMarkdown report containing analysis summary, methodologies, key figures, and recommendations.\n",
    "\n",
    "**Toolkit**\n",
    "- R (in the Rstudio IDE) for data wrangling, visualizations, and analysis\n",
    "- Tableau for Visualizations\n"
   ]
  },
