    "## 2.0 About The Data \n",
    "\n",
    "The data for this project is availabe for download at <https://divvy-tripdata.s3.amazonaws.com/index.html>\\\n",
    "\\**note that the datasets is divided by month, so if replicating, make sure to match the dates.*\n",
    "\n",
    "You can also connect to this source on kaggle: https://www.kaggle.com/michaeljohnsonjr/divvytrips2021\n",
    "\n",
    "### 2.1 Dataset Overview\n",
    "Description : Cyclistic trip data 2021 \\\n",
    "Time Span: Jan 2021 - Dec 2021 \\\n",
    "Source: Internal \\\n",
    "Format : .CSV compressed in .ZIP folder \\ \n",
    "Licence : <https://ride.divvybikes.com/data-license-agreement> \\\n",
    "\n",
    "#### Features:\n",
    "* ride_id : unique code for each trip  \n",
    "* ride_able_type : the type of bicycle  \n",
    "* started_at : datetime of starting trip in local time\n",
    "* ended_at : datetime of ended trip in local time\n",
    "* start_station_name : station name for start\n",
    "* start_station_id : station id for start\n",
    "* end_station_name : station name for finish\n",
    "* end_station_id : station id for finish\n",
    "* start_lat : latitude coordinate for start\n",
    "* start_lng : longitude coordinate for start\n",
    "* end_lng: longitude coordiation for finish\n",
    "* end_lat : latitude coordinate for finish\n",
    "* member_casual : the type of user / pricing plan\n",
    "\n",
    "### 3.0 Import and Preprocessing\n",
    "\n",
    "These inital steps will perform the accessing of the raw data. Initially when running this process on my local system, I had downloaded the individual files into a local directory to load with working with R Studio. Since the data exists as a dataset here on Kaggle, I will connect directly. If downloading the files locally, you will need to extract the .csv files and then merge them."
   ]
  },
