    "#need a list of file names to iterate over \n",
    "files <- list.files(\"../input/divvytrips2021\")\n",
    "\n",
    "#extracting dataframes into a list for inspection before merging\n",
    "data_sets <- lapply(files, function(x) read_csv(paste0(\"../input/divvytrips2021/\",x), show_col_types = FALSE))\n",
    "\n",
    "#naming each frame in the list by year and month so we can easily compare datatypes \n",
    "names(data_sets) <- sapply(files, function(x) str_extract(x, \"\\\\d{6}\"))\n",
    "      \n",
    "#cleanup environment                           \n",
    "rm(files)"
   ]
