   "source": [
    "### 3.1 Clean Data\n",
    "\n",
    "Now that we have a merged set and a report showing some helpful information, we'll go through a process to make sure the data is [tidy](https://cran.r-project.org/web/packages/tidyr/vignettes/tidy-data.html) and prepared for further analysis. In this stage, I'm looking for common errors such as:\n",
    "\n",
    "1. Missing data\n",
    "2. Duplicate data\n",
    "3. Inconsistent or problematic column names formats\n",
    "4. Non-uniform formatting of data \n",
    "5. Mistyping of data\n",
    "6. Mispellings\n",
    "7. Features with little variation\n",
    "8. Irrelevant features \n",
    "\n",
    "In order to have good results in analysis, our data has to be as reliable and complete as we can make it. It's good practice to be methodical and curious here because there are numerous ways data can be problematic that sometimes aren't obvious. We may need to come back to this stage again in order to fix any issues found later. We'll do some exploratory analysis to get a feel for what the data look like, the values we expect, and note any transformations that need to happen before we move on to analysis."
   ]
  },
