   "source": [
    "#format column names for consistency\n",
    "raw_data <- janitor::clean_names(raw_data)\n",
    "\n",
    "#rename columns to make them better descriptors\n",
    "tidy_data <- raw_data %>% \n",
    "  rename(\"biketype\" = rideable_type,\n",
    "         \"start_time\" = started_at,\n",
    "         \"end_time\" = ended_at,\n",
    "         \"from_station\" = start_station_name,\n",
    "         \"to_station\" = end_station_name,\n",
    "         \"usertype\" = member_casual)\n",
    "\n",
    " #some \"character\" feature classes should be \"factors\": \n",
    "to_factor_cols <- c(\"biketype\", \"usertype\", \"to_station\", \"from_station\", \"start_station_id\", \"end_station_id\")\n",
    "tidy_data[to_factor_cols] <- lapply(tidy_data[to_factor_cols], as.factor)"
   ]
