   "source": [
    "#### Calculated Fields\n",
    "\n",
    "Now that the original fields are formatted, let's consider some calculated fields that could come in handy as we attempt to answer our business question. Here it's useful to consider the characteristics by which we might want to compare between a casual rider and an annual member:\n",
    "\n",
    "1. **Ride duration** : how long they tend to take a trip, this could be found with our start and end times\n",
    "2. **Travel destinations** : where do casual riders tend to visit compared with member riders?\n",
    "3. **Time-components of ride behavior** : common ride times during the day, seasonal components, tendencies during the week\n",
    "4. **Bike type preferences** : which kind of bike do casual riders tend towards, is this different from members?\n",
    "\n",
    "From these suggestions I can decide that it may be helpful to transform our dataset with some added features we can use to examine behaviors later.\n",
    "\n",
    "1. **Time and date features** : Days of week, weekdays, hours, months, weekday or weekend\n",
    "2. **Ride duration** : the difference between end_time and start_time in minutes\n",
    "\n",
    "These should be simple and safe to calculate, so we'll do that next. "
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 9,
   "id": "fffdbf37",
   "metadata": {
