   "source": [
    "#calculate date features to simplify time-based aggregation during analysis\n",
    "tidy_data <- tidy_data %>% \n",
    "  mutate(date = date(start_time),\n",
    "         year = year(date),\n",
    "         month = month(date),\n",
    "         day = day(date),\n",
    "         hour = hour(date),\n",
    "         month_name = factor(month.abb[month], levels = month.abb),\n",
    "         day_of_week = factor(weekdays(date), levels = c('Monday','Tuesday','Wednesday',\n",
    "                                                         'Thursday','Friday','Saturday','Sunday')))\n",
    "    \n",
    "#create measure for ride duration in minutes to compare ride times\n",
    "tidy_data <- tidy_data %>% \n",
    "  mutate(ride_duration = round(as.integer(end_time - start_time)/60, 2))"
   ]
  },
