    "### 3.4 Cleaning Values\n",
    "\n",
    "From the skimr reports I've noticed a couple of things to address before moving on to the initial analysis phase.\n",
    "\n",
    "1. Ride duration contains negative values, this doesn't make intuitive sense. (unless they're time traveling?!)\n",
    "2. There are some extremely high values for ride duration. (that's almost a 39 day bike ride)\n",
