   },
   "source": [
    "Moving on to the rest of the values - we had some high values to explore. When we plot the distribution of ride_duration values, it's clearly extremely skewed. I know there's at least a value of 55944.15, let's look into any other extreme positive values.\n",
    "\n",
    "An easy way to get a sense of how things are distributed is to look at quantiles. Since 97.5% of our ride times are at or below ~ 82 minutes, I'm going to filter the dataset for values within this quantile to make our measurements more meaningful."
   ]
  },
