   "source": [
    "## 4.0 Analysis\n",
    "\n",
    "Now that the dataset appears sufficiently tidy, we can move on to addressing the key task for this assignment:\n",
    "\n",
    "**Key Task:** Analyze rider data to show how causal riders use Cyclistic's bikeshare service differently than members.\n",
    "\n",
    "Earlier I had developed some characteristics of ridership which might be fruitful to explore. I'll restate those here:\n",
    "\n",
    "1. **Ride duration** : how long they tend to take a trip, this could be found with our start and end times\n",
    "2. **Travel destinations** : where do casual riders tend to visit compared with member riders?\n",
    "3. **Time-components of ride behavior** : common ride times during the day, seasonal components, tendencies during the week\n",
    "4. **Bike type preferences** : which kind of bike do casual riders tend towards, is this different from members?\n",
    "\n",
    "With all these in mind, we'll move into doing some exploratory analysis to attempt to show any defining tendencies and variation which might suggest a difference between these two user types. \n",
    "\n",
    "\n"
   ]
  },
