   "source": [
    "### 4.1 Ride Duration\n",
    "\n",
    "Casual riders tend to ride longer than members. \n",
    "\n",
    "Let's compare ride times for members and casual riders with a simple chart. By taking the median ride time of each day for both casual and member riders, there is a clear distinction between the two. Generally speaking, casual riders took longer bike rides than annual members throughout the year.\n",
    "\n",
    "Another observation worth noting in the visualization below, is the larger spread (variance) of the median ride times for casual riders. Ride durations are less uniform amongst for casual riders compared to members. We should this in mind as we move into the next component of the analysis. "
   ]
  },
