   "source": [
    "#using median as central tendency measure since ride_duration is heavily left skewed\n",
    "tidy_data_v3 %>%  \n",
    "    ggplot() +\n",
    "    geom_hline(yintercept = 15.12, color=\"#8bc34aff\") +\n",
    "    geom_hline(yintercept = 9.57, color=\"#00517cff\") +\n",
    "    stat_summary(mapping=aes(x = date, y = ride_duration, color = usertype), alpha = .8,fun = median) +\n",
    "    labs(title=\"Casual Riders: Longer Ride Times Than Members\",\n",
    "       subtitle=\"Comparing Daily Median Ride Durations\",\n",
    "       y = \"Ride Duration (Minutes)\",\n",
    "       x = \"Date\",\n",
    "       color = \"User Type\") +\n",
    "    scale_color_manual(values=c(\"#8bc34aff\", \"#00517cff\"))\n",
    "  "
