   "source": [
    "### 4.2 Time-Based Ride Behavior\n",
    "\n",
    "Casual riders ride bikes at different times than members. \n",
    "\n",
    "If we look into the number of rides taken by either usertype, aggregated by each day of the week, we can see that casual riders tend to ride less often on working week days, but tend to pass member riders on the weekends. This seems to point to a key characteristic that differentiates casual riders from members: casual riders appear to be more likely to use the service for non-work purposes whereas members may tend to use the service for the practical purposes of communting to and from work. "
   ]
  },
