   "source": [
    "tidy_data_v3 %>%\n",
    "  mutate(weekday = wday(start_time, label = TRUE)) %>%\n",
    "  group_by(usertype, weekday) %>%\n",
    "  summarise(number_of_rides = n()\n",
    "            ,average_duration = mean(ride_duration)) %>%\n",
    "  arrange(usertype, weekday) %>%\n",
    "  ggplot(aes(x = weekday, y = number_of_rides, fill = usertype)) +\n",
    "  geom_col(position = \"dodge\") +\n",
    "  scale_y_continuous(labels=scales::comma) + labs(title=\"Casual Riders Favor Weekend Rides To Workday Commutes\",\n",
    "                                                  subtitle=\"Total Rides from Jan. 1, 2021 - Dec. 31, 2021\", \n",
    "                                                  x=\"Day of Week\" , y=\"Total Number of Rides\",\n",
    "                                                  fill = \"User Type\") + theme(legend.position = \"bottom\") + \n",
    "scale_fill_manual(values=c(\"#8bc34aff\", \"#00517cff\"))"
   ]
