   "source": [
    "### 4.3 Destinations \n",
    "\n",
    "We can see that casual riders tend to visit different areas than members.\n",
    "\n",
    "We can see where each user type tend to visit buy summarizing the top 5 destinations in the past year for each. An overwhelming majority of casual riders visit the station of Streeter Dr. and Grand Ave. -- over twice the number of the next most visited location, Millenium Park. "
   ]
