   "source": [
    "Below we can get a more intuitive grasp of popular areas for casual riders vs members. The first visual indicates where each user type tends to visit by showing a heat map of all rides. So what can we see from the distribution? We can see there is some overlap in the general ridership between these two types, but there are some differences in where most rides end. It appears that casual riders have a bit more specificity in where they tend to ride, whereas member riders show a flatter distribution of destinations. This makes sense, there are likely more tourists who are casual riders than members. \n",
    "\n",
    "The second figure below will simplify the picture for ride concentration by showing the top 5 destinations for each customer class. \n",
    "\n",
    "\n"
