   "source": [
    "## 5.0 Conclusions and Recommendations\n",
    "\n",
    "To summarize the observations from the analysis, some key characteristics for casual riders are:\n",
    "\n",
    "1. ~50% longer ride times than members: ~15 min vs ~10 mins when comparing median ride duration.\n",
    "2. Preference for weekend rides vs the preference for rides on work days for members.\n",
    "3. Tendency to visit coastal areas as opposed to business districts.\n",
    "\n",
    "If we were to characterize a casual rider, they are typically weekend riders, they tend to use the service during the late-spring through summer months, when the climate is ideal, and they tend to visit areas with good views or tourist attractions along the coast. \n",
    "\n",
    "### 5.1 Recommendations\n",
    "\n",
    "From these characteristics, recommendations for the marketing team are as follows:\n",
    "\n",
    "1. Frame marketing language around the savings to be made on a per-ride basis compared to other forms of transportation. Given that casual riders tend to visit tourist landmarks, there is opportunity to position a membership for tourists who want to keep costs low or allocate more of their travel budget toward experiences. \n",
    "\n",
    "    1.1 Alternatively, a \"Season Pass\" product could be created that costs less than an annual membership and more than several single rides that could ease the calculation on the rider.\n",
    "\n",
    "2. Consider launching a campaign around from the months of April to July, as this is when casual ridership tends to peak. While marketing efforts could be used to boost ridership in the off-season, there appears more opportunity (due to ride duration variance) in the summer months if the goal is to convert riders to purchase an annual membership. \n",
    "\n",
    "3. Language for the marketing campaign should focus attention on the enjoyment of riding a bike through the city during the more pleasant times of the year. Since ride times tend to show more variance in the summer months, we can infer that the casual rider is one who is choosing the service for a pleasurable, novel, experience. \n",
    "\n",
    "\n",
    "### 5.2 Suggestions For Future Analysis\n",
    "\n",
    "Marketing efforts could be better informed by looking into individual rider characteristics. One limitation of the dataset is that we are unable to see how many times an individual rider used the service. If we can examine the frequency of rides for individuals, we can inform the marketing team on common patterns which tend to lead to conversions to memberships. This could lead to faster conversion and higher revenues in both the short and long run.  \n",
    "\n"
   ]
